import React from "react";
import IITILOGO from "./images/iitilogo.png";
import "./left.css";

export default function Left() {
  let secondleft = document.querySelector(".secondleft");
  let collapsed = document.querySelector("collapsed");
  let top = document.querySelector(".top");
  const hide = () => {
    if (collapsed) {
      secondleft.classList.remove("collapsed");
      secondleft.classList.remove(".secondleft");
      top.style.rotate = "180deg";
    } else {
      secondleft.classList.add("collapsed");
      secondleft.classList.add(".secondleft");
      top.style.rotate = "180deg";
    }
  };

  return (
    <>
      <div className="left d-flex">
        <div className="firstleft d-flex">
          <a href="/" onclick={hide} className="top">
            <i className="fa-solid fa-angles-left"></i>
          </a>

          <a href="/" className="mx-8">
            <i className="fa-solid fa-qrcode"></i>
          </a>
          <a href="/">
            <i className="fa-regular fa-user"></i>
          </a>
          <a href="/">
            <i className="fa-regular fa-user"></i>
          </a>
          <a href="/">
            <i className="fa-solid fa-table-cells"></i>
          </a>
          <a href="/">
            <a href="/">
              <i className="fa-solid fa-square-poll-horizontal"></i>
            </a>
          </a>
        </div>
        <div className="secondleft ">
          <a href="/" onclick={hide} className="top">
            Hide
          </a>
          <a href="/">Dashboard</a>
          <a href="/">Profile</a>
          <a href="/">Enroll</a>
          <a href="/">TimeTable</a>
          <a href="/">Polls</a>
          <div className="logo">
            <img src={IITILOGO} alt="logo" />
          </div>
        </div>
      </div>
    </>
  );
}
